import React from 'react';
import styled from 'styled-components';

const TextCont = styled.div`
    display:flex;
    flex-direction: column;
`;

const Header = styled.h1`
font-family: sans-serif;
font-size: 38px;
`;






const Text = ({}) => {
    return <TextCont>
        <Header>
            Welcome
        </Header>
    </TextCont>
}

export default Text;
